$(document).ready(function(){$.getJSON("../datas/companies.json",function(t){$.each(t.agences.bruxelles,function(t,e){var a="<tr><td>"+e.agence+"</td><td>"+e.address+"</td><td>"+e.cp+"</td><td>"+e.tags+"</td><td><a href='"+e.website+"' target='_blank'>Website</a></td></tr>";$(a).appendTo(".filtre table tbody")})}),$(".searchButton").on("click",function(){var t=$("#search").val();$(".test").append(t),console.log(t)}),$(".searchButton").on("keypress",function(t){if(13==t.which){var e=$("#search").val();$(".test").append(e),console.log(e)}})});